pub enum BindError {
    Conversion(Box<Error + marker::Sync + Send>),
    Serialization(io::Error),
}

pub enum RangeBound<T> {

    /// An inclusive bound.
    Inclusive(T),

    /// An exclusive bound.
    Exclusive(T),

    /// No bound.
    Unbounded,
}

pub enum Range<'a> {

    /// An empty range.
    Empty,

    /// A nonempty range.
    Nonempty(RangeBound<Option<&'a [u8]>>, RangeBound<Option<&'a [u8]>>),
}

pub enum IsNull {

    /// The value is `NULL`.
    Yes,

    /// The value is not `NULL`.
    No,
}
